        "_ct": "text/plain",
        "_pt": "resource/content",
        "_content": "\x3C!DOCTYPE html>\n\x3Chtml lang=\"en\">\n\n\x3Chead>\n  \x3Cmeta charset=\"utf-8\">\n  \x3Cmeta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  \x3Cmeta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0\">\n  \x3Clink rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  {{include_css \"resource/content/edit.css\" \"resource/res-ui.css\"}}\n  {{include_js \"resource/res-ui.js\"}}\n\n  \x3Ctitle>edit:{{R.PATH}}\x3C/title>\n\x3C/head>\n\n\x3Cbody>\n  \x3Cdiv class=\"head\">\n    \x3Col class=\"paths\">\n      \x3Cli>\x3Ca href=\"{{req_path \"/\" \"res-list\"}}\">HOME\x3C/a>\x3C/li>\n{{#include \".\" \"parents\"}}\n      \x3Cli>\x3Ca href=\"{{req_path path \"res-list\"}}\">{{name}}\x3C/a>\x3C/li>\n{{/include}}\n      \x3Cli>{{name}}\x3C/li>\n    \x3C/ol>\n\n{{#match isTextContentResource}}\n    \x3Cdiv class=\"buttons\">\n      \x3Ca href=\"{{req_path \"..\" \"res-list\"}}\">cancel\x3C/a>\n      \x3Cbutton type=\"submit\" form=\"text_form\">save\x3C/button>\n    \x3C/div>\n\n  \x3C/div>\n\n  \x3Cform method=\"post\" action=\"{{res_path R.PATH}}\" id=\"text_form\">\n    \x3Cinput type=\"hidden\" name=\":forward\" value=\"{{req_path \".\"}}\">\n\n    \x3Ctextarea autocorrect=\"off\" autocapitalize=\"none\" autocomplete=\"off\" autofocus=\"on\" spellcheck=\"false\" name=\"_content\">{{include_safe \".\" \"text\"}}\x3C/textarea>\n\n    \x3Cinput type=\"hidden\" name=\"_rt\" value=\"resource/content\">\x3C/input>\n    \x3Cinput type=\"hidden\" name=\"_ct\" value=\"{{contentType}}\">\x3C/input>\n  \x3C/form>\n\n{{/match}}\n{{#match contentType \"startsWith\" \"image/\"}}\n    \x3Cdiv class=\"toolbar\">\n      \x3Ca href=\"{{req_path \"..\" \"res-list\"}}\">cancel\x3C/a>\n      \x3Ca target=\"_blank\" href=\"{{include \".\" \"externalize\"}}\">view\x3C/a>\n    \x3C/div>\n\n  \x3C/div>\n\n  \x3Cimg src=\"{{include \".\" \"externalize\"}}\" id=\"image_view\">\x3C/img>\n\n{{/match}}\n{{#match contentType \"startsWith\" \"application/pdf\"}}\n\n    \x3Cdiv class=\"toolbar\">\n      \x3Ca href=\"{{req_path \"..\" \"res-list\"}}\">cancel\x3C/a>\n      \x3Ca target=\"_blank\" href=\"{{include \".\" \"externalize\"}}\">open\x3C/a>\n    \x3C/div>\n  \n  \x3C/div>\n\n  \x3Ciframe src=\"{{include \".\" \"externalize\"}}\" id=\"pdf_view\">\x3C/iframe>\n\n{{/match}}\n{{#default}}\n\n    \x3Cdiv>unknown file type of {{contentType}}\x3C/div>\n    \x3Ca href=\"{{include \".\" \"externalize\"}}\" download target=\"_blank\">Download\x3C/a>\n\n{{/default}}\n  \x3Cscript>fix_textarea()\x3C/script>\n\x3C/body>\n\n\x3C/html>\n"
