        "_content": "\x3C!DOCTYPE html>\n\x3Chtml lang=\"en\">\n\n\x3Chead>\n  \x3Cmeta charset=\"utf-8\">\n  \x3Cmeta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  \x3Cmeta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0\">\n  \x3Clink rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  {{include_css \"resource/res-ui.css\" \"resource/node/res-list.css\"}}\n\n  \x3Ctitle>properties:{{R.PATH}}\x3C/title>\n\x3C/head>\n\n\x3Cbody>\n\n  \x3Col class=\"paths\">\n    \x3Cli>\x3Ca href=\"{{req_path \"/\" \"res-list\"}}\">HOME\x3C/a>\x3C/li>\n{{#include \".\" \"parents\"}}\n    \x3Cli>\x3Ca href=\"{{req_path path \"res-list\"}}\">{{name}}\x3C/a>\x3C/li>\n{{/include}}\n    \x3Cli>{{name}}\x3C/li>\n  \x3C/ol>\n\n  \x3Cdiv class=\"buttons\">\n    \x3Ca href=\"{{req_path \".\" \"res-renderer\"}}\">r\x3C/a>\n    \x3Ca href=\"{{req_path \".\" \"res-list\"}}\">list\x3C/a>\n  \x3C/div>\n\n  \x3Ch4>Resource Properties\x3C/h4>\n\n  \x3Ctable>\n{{#include \".\" \"keyvalues\"}}\n    \x3Ctr>\n      \x3Ctd>{{name}}\x3C/td>\n      \x3Ctd>\n        \x3Cinput name=\"{{name}}\" value=\"{{value}}\" form=\"save_form\" autocorrect=\"off\" autocapitalize=\"none\" autocomplete=\"off\" spellcheck=\"false\">\n      \x3C/td>\n      \x3Ctd>\n        \x3Cbutton type=\"submit\" form=\"save_form\" style=\"display:none\">+\x3C/button>\n        \x3Cform method=\"post\" action=\"{{res_path \".\"}}\">\n          \x3Cinput type=\"hidden\" name=\":forward\" value=\"{{req_path \".\"}}\">\n          \x3Cbutton type=\"submit\" name=\"{{name}}\">-\x3C/button>\n        \x3C/form>\n      \x3C/td>\n    \x3C/tr>\n{{/include}}\n    \x3Ctr>\n      \x3Ctd>\n        \x3Cinput name=\":name\" value=\"\" autocorrect=\"off\" autocapitalize=\"none\" autocomplete=\"off\" spellcheck=\"false\" placeholder=\"name\" form=\"save_form\">\n      \x3C/td>\n      \x3Ctd>\n        \x3Cinput name=\"{:name}\" value=\"\" autocorrect=\"off\" autocapitalize=\"none\" autocomplete=\"off\" spellcheck=\"false\" placeholder=\"value\" form=\"save_form\">\n      \x3C/td>\n      \x3Ctd>\n        \x3Cbutton type=\"submit\" form=\"save_form\">+\x3C/button>\n      \x3C/td>\n    \x3C/tr>\n  \x3C/table>\n\n  \x3Cform method=\"post\" action=\"{{res_path \".\"}}\" id=\"save_form\">\n    \x3Cinput type=\"hidden\" name=\":forward\" value=\"{{req_path \".\"}}\">\n  \x3C/form>\n\n\x3C/body>\n\x3C/html>\n"
