      "res-renderer.hbs": {
        "_ct": "text/plain",
        "_pt": "resource/content",
        "_content": "\x3C!DOCTYPE html>\n\x3Chtml lang=\"en\">\n\n\x3Chead>\n  \x3Cmeta charset=\"utf-8\">\n  \x3Cmeta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  \x3Cmeta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0\">\n  \x3Clink rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  {{include_css \"resource/res-ui.css\"}}\n\n  \x3Ctitle>renderer properties\x3C/title>\n\x3C/head>\n\n\x3Cbody>\n\n  \x3Ch3>Renderer Properties\n    \x3Ca class=\"button\" href=\"{{req_path R.PATH \"res-list\"}}\">cancel\x3C/a>\n  \x3C/h3>\n \n  \x3Col class=\"paths\">\n    \x3Cli>\x3Ca href=\"{{req_path \"/\" \"res-list\"}}\">HOME\x3C/a>\x3C/li>\n{{#include \".\" \"parents\"}}\n    \x3Cli>\x3Ca href=\"{{req_path path \"res-list\"}}\">{{name}}\x3C/a>\x3C/li>\n{{/include}}\n    \x3Cli>{{name}}\x3C/li>\n  \x3C/ol>\n  \n  \x3Ch4>Set User Defined Renderers\x3C/h4>\n    \n  \x3Cp>User defined renderer templates are stored in \x3Ca href=\"{{req_path C.USER_TEMPLATES \"/\" renderType \"res-list\"}}\">{{C.USER_TEMPLATES}}/{{renderType}}\x3C/a>\n  \x3Ca class=\"button\" href=\"{{req_path C.USER_TEMPLATES \"res-create\"}}\">create template...\x3C/a>\n  \x3C/p>\n\n  \x3Ch4>Renderer will take following types into consideration\x3C/h4>\n  \x3Col>\n{{#if renderType}}\n      \x3Cli>renderType: \x3Cb>{{renderType}}\x3C/b>\x3C/li>\n{{else}}\n      \x3Cli>renderType: \x3Cb>no type set\x3C/b>\x3C/li>\n{{/if}}\n{{#if renderSuperType}}\n      \x3Cli>renderSuperType: \x3Cb>{{renderSuperType}}\x3C/b>\x3C/li>\n{{/if}}\n{{#if contentType}}\n      \x3Cli>contentType: mime/\x3Cb>{{contentType}}\x3C/b>\x3C/li>\n{{/if}}\n      \x3Cli>resourceType: \x3Cb>{{type}}\x3C/b>\x3C/li>\n{{#if superType}}\n      \x3Cli>superType: \x3Cb>{{superType}}\x3C/b>\x3C/li>\n{{/if}}\n      \x3Cli>fallback: \x3Cb>any/any\x3C/b>\x3C/li>\n  \x3C/ol>          \n\n  \x3Cform method=\"post\" id=\"save_form\" action=\"{{R.PATH}}\">\n    \x3Clabel>render type\x3C/label>\n    \x3Cselect name=\"_rt\">\n      \x3Coption value=\"\">not set\x3C/option>\n      \x3Coption disabled>-\x3C/option>\n{{#include C.USER_TEMPLATES \"rendertemplates\"}}\n      \x3Coption value=\"{{this}}\" {{eq this ../renderType \"selected\"}}>{{this}}\x3C/option>\n{{/include}}\n    \x3C/select>\n            \n    \x3Clabel class=\"col-sm-4\">render super type\x3C/label>\n    \x3Cselect class=\"form-control\" name=\"_st\">\n      \x3Coption value=\"\">not set\x3C/option>\n      \x3Coption disabled>-\x3C/option>\n{{#include C.USER_TEMPLATES \"rendertemplates\"}}\n      \x3Coption value=\"{{this}}\" {{eq this ../renderSuperType \"selected\"}}>{{this}}\x3C/option>\n{{/include}}\n    \x3C/select>\n\n    \x3Cinput type=\"hidden\" name=\":forward\" value=\"{{ref_path R.PATH \"res-list\"}}\">\n    \x3Cbutton type=\"submit\">save\x3C/button>\n  \x3C/form>\n\n\x3C/body>\n\n\x3C/html>\n"
      },
