        "_content": "\x3C!DOCTYPE html>\n\x3Chtml lang=\"en\">\n\n\x3Chead>\n  \x3Cmeta charset=\"utf-8\">\n  \x3Cmeta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  \x3Cmeta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0\">\n  \x3Clink rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  {{include_css \"resource/res-ui.css\"}}\n\n  \x3Ctitle>create\x3C/title>\n\x3C/head>\n\n\x3Cbody>\n\n  \x3Ch3>Create New Root Resource\n    \x3Ca class=\"button\" href=\"{{req_path \".\" \"res-list\"}}\">cancel\x3C/a>\n  \x3C/h3>\n\n  \x3Ch4>Temporary ObjectResource\x3C/h4>\n\n  \x3Cform method=\"post\" action=\"{{res_path R.PATH \"{:name}\"}}\">\n    \x3Cinput name=\":name|newUUID\" value=\"\" autocomplete=\"off\" placeholder=\"name\">\n    \x3Cinput type=\"hidden\" name=\":forward\" value=\"{{req_path R.PATH \"res-list\"}}\">\n    \x3Cbutton type=\"submit\">add\x3C/button>\n  \x3C/form>\n\n  \x3Ch4>Import File\x3C/h4>\n  \n  \x3Cform method=\"post\" enctype=\"multipart/form-data\" action=\"{{R.PATH}}\">\n    \x3Cinput type=\"file\" name=\":import\" value=\"\">\n    \x3Cinput type=\"hidden\" name=\":forward\" value=\"{{req_path \".\" \"res-list\"}}\">\n\n    \x3Cbutton type=\"submit\">import\x3C/button>\n  \x3C/form>\n\n\x3C/body>\n\x3C/html>\n"
