    "templates": {
      "rendertemplates.js": {
        "_ct": "text/javascript",
        "_pt": "resource/content",
        "_content": "(async function (res, writer, ctx) {\n  writer.start('object/javascript');\n  \n  let types = [];\n  \n  await ctx.listAllResourceNames('.', function (path) {\n    if (path.indexOf('.') > 0) {\n      let name = Utils.filename(path);\n      let dir = Utils.filename_dir(path).substr(1);\n      if (!types.includes(dir)) types.push(dir);\n    }\n  });\n\n  writer.write(types.sort());\n  writer.end();\n});\n"
      },
      "res-create.hbs": {
        "_ct": "text/plain",
        "_pt": "resource/content",
        "_content": "\x3C!DOCTYPE html>\n\x3Chtml lang=\"en\">\n\n\x3Chead>\n  \x3Cmeta charset=\"utf-8\">\n  \x3Cmeta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  \x3Cmeta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, maximum-scale=1.0\">\n  \x3Clink rel=\"icon\" href=\"data:;base64,iVBORw0KGgo=\">\n\n  {{include_css \"resource/res-ui.css\"}}\n\n  \x3Ctitle>create\x3C/title>\n\x3C/head>\n\n\x3Cbody>\n\n  \x3Ch3>Create New Template in \"{{name}}\"\n    \x3Ca class=\"button\" href=\"{{req_path \".\" \"res-list\"}}\">cancel\x3C/a>\n  \x3C/h3>\n  \n  \x3Col class=\"paths\">\n    \x3Cli>\x3Ca href=\"{{req_path \"/\" \"res-list\"}}\">HOME\x3C/a>\x3C/li>\n{{#include \".\" \"parents\"}}\n    \x3Cli>\x3Ca href=\"{{req_path path \"res-list\"}}\">{{name}}\x3C/a>\x3C/li>\n{{/include}}\n    \x3Cli>{{name}}\x3C/li>\n  \x3C/ol>\n\n  \x3Ch4>Renderer Template\x3C/h4>\n\n  \x3Cp>\n    Renderer template is resolved by scanning for a file matching specific naming convention pattern.\n  \x3Cp>\n    Pattern is composed of these parts: \x3Cbr>\n    \x3Cspan>resource type\x3C/span> - usually a directory\x3Cbr>\n    \x3Cspan>selector\x3C/span> - \"default\" or what gets appended after \"{{C.X}}\" like \"json\" for {{C.X}}json\n  \x3Cp>\n    for example:\n  \x3Cul>\n    \x3Cli>\x3Cspan>web/mycomponent/\x3C/span>\x3Cb>default.hbs\x3C/b>\x3C/li>\n  \x3C/ul>\n\n  \x3Cform method=\"post\" action=\"{{R.PATH}}/{:name}/{:sel}.{:ext}\">\n    \x3Cinput name=\":name\" value=\"{{R.DATA_PATH}}\" placeholder=\"full path\" required=\"\" autocomplete=\"off\">\n    {{C.X}}\n    \x3Cinput name=\":sel\" value=\"default\" placeholder=\"selector\" required=\"\" autocomplete=\"off\">\n    .\n    \x3Cselect name=\":ext\" style=\"width:40px\">\n      \x3Coptgroup label=\"Handlebars\">\n        \x3Coption value=\"hbs\">hbs\x3C/option>\n      \x3C/optgroup>\n      \x3Coptgroup label=\"Javascript\">\n        \x3Coption value=\"js\">js\x3C/option>\n      \x3C/optgroup>\n    \x3C/select>\n\n    \x3Cinput type=\"hidden\" name=\"_content\" value=\"\"> \n    \x3Cinput type=\"hidden\" name=\"_rt\" value=\"resource/content\"> \n    \x3Cinput type=\"hidden\" name=\":forward\" value=\"{{req_path \".\" \"/{:name}/{:sel}.{:ext}\" \"edit\"}}\">\n\n    \x3Cbutton type=\"submit\" value=\"add\">add\x3C/button>\n  \x3C/form>\n\n  \x3Ch4>Create Directory\x3C/h4>\n\n  \x3Cform method=\"post\" action=\"{{res_path R.PATH \"{:name}\"}}\">\n    \x3Cinput name=\":name\" value=\"\" required=\"\" placeholder=\"full path\" autocomplete=\"off\">\n    \x3Cinput type=\"hidden\" name=\":forward\" value=\"{{req_path R.PATH \"res-list\"}}\">\n\n    \x3Cbutton type=\"submit\" value=\"add\">add\x3C/button>\n  \x3C/form>\n\n  \x3Ch4>Upload File\x3C/h4>\n  \n  \x3Cform method=\"post\" enctype=\"multipart/form-data\" action=\"{{res_path R.PATH}}\">\n    \x3Cinput type=\"file\" name=\":import\" value=\"\">\n    \x3Cinput type=\"hidden\" name=\":forward\" value=\"{{req_path R.PATH \"res-list\"}}\">\n\n    \x3Cbutton type=\"submit\">upload\x3C/button>\n  \x3C/form>\n\n\x3C/body>\n\x3C/html>\n"
      }
    }
