      "pre-store.js": {
        "_ct": "text/javascript",
        "_pt": "resource/content",
        "_content": "(async function (res, writer, ctx) {\n  let command = res[':command'];\n  let path = ctx.getCurrentResourcePath();\n  let rstype = 'resource/node';\n  let sel = 'res-shell';\n  let out = \"\";\n\n  try {\n    let x = eval(command);\n    out += x;\n  }\n  catch(ex) {\n    out += ex;\n  }\n\n  let rv = await ctx.renderResource(path, rstype, sel);\n  if (rv) {\n    rv.content = rv.content.replace('XXX', 'hello:' + out);\n    writer.write(rv);\n  }\n  writer.end();\n});\n"
      }
